Transformers Prime - Season 2 - Complete (HDTV - MP4)
-----------------------------------------------------

Team Prime lives on Earth as a pre-emptive measure against the return of the
Decepticons. Autobot Central Command is located in a converted missile silo
in Nevada which was provided by the United States government, with whom the
Autobots have formed an alliance. However, the presence of Transformers on
Earth is not generally known among the civilian population. The Autobots have
taken three human teens under their protection after their association with
the Autobots put them in danger from the Decepticons.

Produced by Hasbro Studios.

Animated by Polygon Pictures.

